import classes from "./TodoItem.module.css";
type Props = {
  id: string;
  text: string;
  onClickFunction: (id: string) => void;
};

export const Todo = ({ id, text, onClickFunction }: Props) => {
  const onClickHandler = () => {
    onClickFunction;
  };

  return (
    <li className={classes.item} key={id} onClick={onClickHandler}>
      {text}
    </li>
  );
};
